import { HomeIcon } from "../icons/HomeIcon";

type CardProps = {
  section: SECTION;
  setSection: Dispatch<SetStateAction<SECTION>>;
};

export default function Card({ section, setSection }: CardProps) {
  window.open("https://www.greetingsisland.com/ecard/pzmixrmv0ltr");
  return <></>;
}
